import logo from './logo.svg';
import './App.css';
import React from 'react';
import Mouse from './component/Mouse'

class App extends React.Component{
  render(){
    return(
      <div>
        <Mouse
        render={mouse=>{
        return <p>当前鼠标的坐标为：{mouse.x},{mouse.y}</p>
      }}>
    </Mouse>
      </div>
    )
  }
}

export default App;
